INSERT INTO `movie` (`id`, `name`, `cover`, `thumbnail`, `synopsis`, `parentsGuide`, `releaseDate`, `length`, `rating`, `popularity`, `isTvSeries`) VALUES
(11, 'Star Wars', 'https://image.tmdb.org/t/p/original//4iJfYYoQzZcONB9hNzg0J0wWyPH.jpg', 'https://image.tmdb.org/t/p/original//btTdmkgIvOi0FFip1sPuZI2oQG6.jpg', 'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.', '', '1977-05-25', '02:00:00', 6.83359, 39.031, 0),
(22, 'Pirates of the Caribbean: The Curse of the Black Pearl', 'https://image.tmdb.org/t/p/original//8AUQ7YlJJA9C8kWk8P4YNHIcFDE.jpg', 'https://image.tmdb.org/t/p/original//tkt9xR1kNX5R9rCebASKck44si2.jpg', 'Jack Sparrow, a freewheeling 17th-century pirate, quarrels with a rival pirate bent on pillaging Port Royal. When the governor\'s daughter is kidnapped, Sparrow decides to help the girl\'s love save her.', '', '2003-07-09', '02:23:00', 6.67708, 38.931, 0),
(120, 'The Lord of the Rings: The Fellowship of the Ring', 'https://image.tmdb.org/t/p/original//pIUvQ9Ed35wlWhY2oU6OmwEsmzG.jpg', 'https://image.tmdb.org/t/p/original//56zTpe2xvaA4alU51sRWPoKPYZy.jpg', 'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.', '', '2001-12-18', '02:58:00', 8, 43.335, 0),
(456, 'The Simpsons', 'https://image.tmdb.org/t/p/original/lnnrirKFGwFW18GiH3AmuYy40cz.jpg', 'https://image.tmdb.org/t/p/original/yTZQkSsxUFJZJe67IenRM0AEklc.jpg', 'Set in Springfield, the average American town, the show focuses on the antics and everyday adventures of the Simpson family; Homer, Marge, Bart, Lisa and Maggie, as well as a virtual cast of thousands. Since the beginning, the series has been a pop culture icon, attracting hundreds of celebrities to guest star. The show has also made name for itself in its fearless satirical take on politics, media and American life in general.', '0', '1989-12-17', '00:00:00', 7.06833, 83.988, 1),
(671, 'Harry Potter and the Philosopher\'s Stone', 'https://image.tmdb.org/t/p/original//aPndWixw0hlH1XAXcSSZxW5LF8m.jpg', 'https://image.tmdb.org/t/p/original//dCtFvscYcXQKTNvyyaQr2g2UacJ.jpg', 'Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths -- and about the villain who\'s to blame.', '', '2001-11-16', '02:31:00', 8, 62.621, 0),
(764, 'Midsomer Murders', 'https://image.tmdb.org/t/p/original//xtSVN9LYFdIS4CK34C61GC84ZH7.jpg', 'https://image.tmdb.org/t/p/original//aOSoNRmQ39D8nxvX8vZOHQNQNDT.jpg', 'The peacefulness of the Midsomer community is shattered by violent crimes, suspects are placed under suspicion, and it is up to a veteran DCI and his young sergeant to calmly and diligently eliminate the innocent and ruthlessly pursue the guilty. ', '0', '1997-03-23', '00:00:00', 8, 44.316, 1),
(1396, 'Breaking Bad', 'https://image.tmdb.org/t/p/original//eSzpy96DwBujGFj0xMbXBcGcfxX.jpg', 'https://image.tmdb.org/t/p/original//1yeVJox3rjo2jBKrrihIMj7uoS9.jpg', 'When Walter White, a New Mexico chemistry teacher, is diagnosed with Stage III cancer and given a prognosis of only two years left to live, he becomes filled with a sense of fearlessness and an unrelenting desire to secure his family\'s financial future at any cost as he enters the dangerous world of drugs and crime.', '0', '2008-01-19', '00:00:00', 8, 51.267, 1),
(1399, 'Game of Thrones', 'https://image.tmdb.org/t/p/original//gX8SYlnL9ZznfZwEH4KJUePBFUM.jpg', 'https://image.tmdb.org/t/p/original//gwPSoYUHAKmdyVywgLpKKA4BjRr.jpg', 'Seven noble families fight for control of the mythical land of Westeros. Friction between the houses leads to full-scale war. All while a very ancient evil awakens in the farthest north. Amidst the war, a neglected military order of misfits, the Night\'s Watch, is all that stands between the realms of men and icy horrors beyond.', '0', '2011-04-17', '00:00:00', 8, 69.386, 1),
(1402, 'The Walking Dead', 'https://image.tmdb.org/t/p/original//xVzvD5BPAU4HpleFSo8QOdHkndo.jpg', 'https://image.tmdb.org/t/p/original//yn7psGTZsHumHOkLUmYpyrIcA2G.jpg', 'Sheriff\'s deputy Rick Grimes awakens from a coma to find a post-apocalyptic world dominated by flesh-eating zombies. He sets out to find his family and encounters many other survivors along the way.', '0', '2010-10-31', '00:00:00', 7, 96.934, 1),
(1403, 'Marvel\'s Agents of S.H.I.E.L.D.', 'https://image.tmdb.org/t/p/original//qtr5i6hOm6oVzTYl3jOQAYP3oc7.jpg', 'https://image.tmdb.org/t/p/original//xjm6uVktPuKXNILwjLXwVG5d5BU.jpg', 'Agent Phil Coulson of S.H.I.E.L.D. (Strategic Homeland Intervention, Enforcement and Logistics Division) puts together a team of agents to investigate the new, the strange and the unknown around the globe, protecting the ordinary from the extraordinary.', '0', '2013-09-24', '00:00:00', 7, 56.489, 1),
(1412, 'Arrow', 'https://image.tmdb.org/t/p/original//dKxkwAJfGuznW8Hu0mhaDJtna0n.jpg', 'https://image.tmdb.org/t/p/original//mo0FP1GxOFZT4UDde7RFDz5APXF.jpg', 'Spoiled billionaire playboy Oliver Queen is missing and presumed dead when his yacht is lost at sea. He returns five years later a changed man, determined to clean up the city as a hooded vigilante armed with a bow.', '0', '2012-10-10', '00:00:00', 6, 57.643, 1),
(1415, 'Elementary', 'https://image.tmdb.org/t/p/original//7sJrNKwzyJWnFPFpDL9wnZ859LZ.jpg', 'https://image.tmdb.org/t/p/original//q9dObe29W4bDpgzUfOOH3ZnzDbR.jpg', 'A modern-day drama about a crime-solving duo that cracks the NYPD\'s most impossible cases. Following his fall from grace in London and a stint in rehab, eccentric Sherlock escapes to Manhattan where his wealthy father forces him to live with his worst nightmare - a sober companion, Dr. Watson.', '0', '2012-09-27', '00:00:00', 7, 53.943, 1),
(1416, 'Grey\'s Anatomy', 'https://image.tmdb.org/t/p/original//y6JABtgWMVYPx84Rvy7tROU5aNH.jpg', 'https://image.tmdb.org/t/p/original//mgOZSS2FFIGtfVeac1buBw3Cx5w.jpg', 'Follows the personal and professional lives of a group of doctors at Seattleâ€™s Grey Sloan Memorial Hospital.', '0', '2005-03-27', '00:00:00', 6, 58.921, 1),
(1418, 'The Big Bang Theory', 'https://image.tmdb.org/t/p/original//nGsNruW3W27V6r4gkyc3iiEGsKR.jpg', 'https://image.tmdb.org/t/p/original//ooBGRQBdbGzBxAVfExiO8r7kloA.jpg', 'The Big Bang Theory is centered on five characters living in Pasadena, California: roommates Leonard Hofstadter and Sheldon Cooper; Penny, a waitress and aspiring actress who lives across the hall; and Leonard and Sheldon\'s equally geeky and socially awkward friends and co-workers, mechanical engineer Howard Wolowitz and astrophysicist Raj Koothrappali. The geekiness and intellect of the four guys is contrasted for comic effect with Penny\'s social skills and common sense.', '0', '2007-09-24', '00:00:00', 7, 319.823, 1),
(1421, 'Modern Family', 'https://image.tmdb.org/t/p/original//snxFgPvHMcpW5f8Q3wu6uRRycww.jpg', 'https://image.tmdb.org/t/p/original//gLAcu4VPCAb90oJvJ4nUJc5ZBQi.jpg', 'The Pritchett-Dunphy-Tucker clan is a wonderfully large and blended family. They give us an honest and often hilarious look into the sometimes warm, sometimes twisted, embrace of the modern family.', '0', '2009-09-23', '00:00:00', 7, 44.394, 1),
(1424, 'Orange Is the New Black', 'https://image.tmdb.org/t/p/original//tQfQjGwtXyczTCt0hGU0UnqA3NW.jpg', 'https://image.tmdb.org/t/p/original//ekaa7YjGPTkFLcPhwWXTnARuCEU.jpg', 'A crime she committed in her youthful past sends Piper Chapman to a women\'s prison, where she trades her comfortable New York life for one of unexpected camaraderie and conflict in an eccentric group of fellow inmates.', '0', '2013-07-11', '00:00:00', 7, 55.205, 1),
(1431, 'CSI: Crime Scene Investigation', 'https://image.tmdb.org/t/p/original//nHaUMYpZ8qtLinqFXbgZoL9orHT.jpg', 'https://image.tmdb.org/t/p/original//iUlElECnCViMIV8GnJwIM4A6Fss.jpg', 'The series follows Las Vegas criminalists working for the Las Vegas Police Department as they use physical evidence to solve grisly murders in this unusually graphic drama, which has inspired a host of other cop-show \"procedurals\". The series mixes deduction, gritty subject matter and character-driven drama. The network later added spin-offs CSI: Miami and CSI: NY, which have both been cancelled after ten and nine seasons respectively.', '0', '2000-10-06', '00:00:00', 7, 39.022, 1),
(1433, 'American Dad!', 'https://image.tmdb.org/t/p/original//vddYkC55H3DqWK5cG5hepSnhzGP.jpg', 'https://image.tmdb.org/t/p/original//eo2Xu4UWXHE8UlBlAktNiSsAmfx.jpg', 'The series focuses on an eccentric motley crew that is the Smith family and their three housemates: Father, husband, and breadwinner Stan Smith; his better half housewife, Francine Smith; their college-aged daughter, Hayley Smith; and their high-school-aged son, Steve Smith. Outside of the Smith family, there are three additional main characters, including Hayley\'s boyfriend turned husband, Jeff Fischer; the family\'s man-in-a-goldfish-body pet, Klaus; and most notably the family\'s zany alien, Roger, who is \"full of masquerades, brazenness, and shocking antics.\"', '0', '2005-02-06', '00:00:00', 6, 51.883, 1),
(1434, 'Family Guy', 'https://image.tmdb.org/t/p/original//pH38r4TWTqq7Mcs6XAlwgzNUeJe.jpg', 'https://image.tmdb.org/t/p/original//gBGUL1UTUNmdRQT8gA1LUV4yg39.jpg', 'Sick, twisted, politically incorrect and Freakin\' Sweet animated series featuring the adventures of the dysfunctional Griffin family. Bumbling Peter and long-suffering Lois have three kids. Stewie (a brilliant but sadistic baby bent on killing his mother and taking over the world), Meg (the oldest, and is the most unpopular girl in town) and Chris (the middle kid, he\'s not very bright but has a passion for movies). The final member of the family is Brian - a talking dog and much more than a pet, he keeps Stewie in check whilst sipping Martinis and sorting through his own life issues.', '0', '1999-01-31', '00:00:00', 7, 59.502, 1),
(1622, 'Supernatural', 'https://image.tmdb.org/t/p/original//koMUCyGWNtH5LXYbGqjsUwvgtsT.jpg', 'https://image.tmdb.org/t/p/original//pui1V389cQft0BVFu9pbsYLEW1Q.jpg', 'When they were boys, Sam and Dean Winchester lost their mother to a mysterious and demonic supernatural force. Subsequently, their father raised them to be soldiers. He taught them about the paranormal evil that lives in the dark corners and on the back roads of America ... and he taught them how to kill it. Now, the Winchester brothers crisscross the country in their \'67 Chevy Impala, battling every kind of supernatural threat they encounter along the way. ', '0', '2005-09-13', '00:00:00', 7, 74.448, 1),
(1668, 'Friends', 'https://image.tmdb.org/t/p/original//efiX8iir6GEBWCD0uCFIi5NAyYA.jpg', 'https://image.tmdb.org/t/p/original//7buCWBTpiPrCF5Lt023dSC60rgS.jpg', 'The misadventures of a group of friends as they navigate the pitfalls of work, life and love in Manhattan.', '0', '1994-09-22', '00:00:00', 8, 61.24, 1),
(1911, 'Bones', 'https://image.tmdb.org/t/p/original//8vv0ielb4e08E0z5E63aDW5MUp1.jpg', 'https://image.tmdb.org/t/p/original//hYqFKoOZ54FOtL7r2WK6gQIMiQg.jpg', 'Dr. Temperance Brennan and herÂ colleagues at the Jeffersonian\'s Medico-Legal Lab assist Special Agent Seeley BoothÂ with murder investigations when the remains are so badly decomposed, burned or destroyed that the standard identification methods are useless.', '0', '2005-09-12', '00:00:00', 7, 39.406, 1),
(2046, 'Alias', 'https://image.tmdb.org/t/p/original//uqu5SuPIr0VQPqXF7CuGY3j2431.jpg', 'https://image.tmdb.org/t/p/original//bMj6iM7TBcceG44vpireA2Axeab.jpg', 'Sydney Bristow, an agent who has been tricked to believe she is working for the U.S. government, is actually working for a criminal organization named the Alliance of Twelve. Upon learning this, Sydney becomes a double agent for the real CIA.', '0', '2001-09-30', '00:00:00', 6, 52.267, 1),
(2190, 'South Park', 'https://image.tmdb.org/t/p/original//mSDKNVvDfitFE6Fb6fSSl5DQmgS.jpg', 'https://image.tmdb.org/t/p/original//v9zc0cZpy5aPSfAy6Tgb6I1zWgV.jpg', 'Follows the misadventures of four irreverent grade-schoolers in the quiet, dysfunctional town of South Park, Colorado.', '0', '1997-08-13', '00:00:00', 8, 51.237, 1),
(2691, 'Two and a Half Men', 'https://image.tmdb.org/t/p/original//27cshLy9anL9G0g6tBQjWkPACx5.jpg', 'https://image.tmdb.org/t/p/original//A9QDK4OWpv41W27kCv0LXe30k9S.jpg', 'A hedonistic jingle writer\'s free-wheeling life comes to an abrupt halt when his brother and 10-year-old nephew move into his beach-front house.', '0', '2003-09-22', '00:00:00', 6, 44.713, 1),
(2734, 'Law & Order: Special Victims Unit', 'https://image.tmdb.org/t/p/original//kOvt2BOOwSAQCT8yo3pM3X2GXjh.jpg', 'https://image.tmdb.org/t/p/original//yzMQBlirydvKp4Zgr5FbXlsrRmw.jpg', 'In the criminal justice system, sexually-based offenses are considered especially heinous. In New York City, the dedicated detectives who investigate these vicious felonies are members of an elite squad known as the Special Victims Unit. These are their stories.', '0', '1999-09-20', '00:00:00', 6, 73.794, 1),
(2883, 'Dark Shadows', 'https://image.tmdb.org/t/p/original//wLgrvxvrxHgWt9AFqbgQUyJYWvH.jpg', 'https://image.tmdb.org/t/p/original//y2t6w8il225T2IRsvpWJ2SzTrSn.jpg', 'Dark Shadows is an American gothic soap opera that originally aired weekdays on the ABC television network, from June 27, 1966, to April 2, 1971. The show was created by Dan Curtis. The story bible, which was written by Art Wallace, does not mention any supernatural elements. It was unprecedented in daytime television when ghosts were introduced about six months after it began.\n\nThe series became hugely popular when vampire Barnabas Collins appeared a year into its run. Dark Shadows also featured werewolves, zombies, man-made monsters, witches, warlocks, time travel, and a parallel universe. A small company of actors each played many roles; indeed, as actors came and went, some characters were played by more than one actor. Major writers besides Art Wallace included Malcolm Marmorstein, Sam Hall, Gordon Russell, and Violet Welles.\n\nDark Shadows was distinguished by its vividly melodramatic performances, atmospheric interiors, memorable storylines, numerous dramatic plot twists, unusually adventurous music score, and broad and epic cosmos of characters and heroic adventures. Now regarded as something of a classic, it continues to enjoy an intense cult following. Although the original series ran for only five years, its scheduling as a daily daytime drama allowed it to amass more single episodes during its run than most other science-fiction/fantasy genre series produced for English-language television, including Doctor Who and the entire Star Trek television franchise. Only the paranormal soap opera Passions, with a total of 2,231 episodes, has more.', '0', '1966-06-27', '00:00:00', 7, 56.79, 1),
(4057, 'Criminal Minds', 'https://image.tmdb.org/t/p/original//mzyLxbwy5jOveyfsbC1OWGp78NV.jpg', 'https://image.tmdb.org/t/p/original//decs76l3VZiOtZ8BNp7KPPj2vcw.jpg', 'An elite team of FBI profilers analyze the country\'s most twisted criminal minds, anticipating their next moves before they strike again. The Behavioral Analysis Unit\'s most experienced agent is David Rossi, a founding member of the BAU who returns to help the team solve new cases.', '0', '2005-09-22', '00:00:00', 7, 43.888, 1),
(4614, 'NCIS', 'https://image.tmdb.org/t/p/original//nymeWHYQ1JaWP2wyNW5a5WHiDCd.jpg', 'https://image.tmdb.org/t/p/original//1ubAPydzsb9VzhqeUGGDA7DZCUy.jpg', 'From murder and espionage to terrorism and stolen submarines, a team of special agents investigates any crime that has a shred of evidence connected to Navy and Marine Corps personnel, regardless of rank or position.', '0', '2005-03-17', '00:00:00', 7, 56.446, 1),
(5559, 'Bee Movie', 'https://image.tmdb.org/t/p/original//2lBpQZevIJdL4vPrZ7Nnm7mrVlm.jpg', 'https://image.tmdb.org/t/p/original//QhbOzpYfBOwrRiuTu9otPk919R.jpg', 'Barry B. Benson, a bee who has just graduated from college, is disillusioned at his lone career choice: making honey. On a special trip outside the hive, Barry\'s life is saved by Vanessa, a florist in New York City. As their relationship blossoms, he discovers humans actually eat honey, and subsequently decides to sue us.', '', '2007-10-28', '01:30:00', 8, 43.042, 0),
(8467, 'Dumb and Dumber', 'https://image.tmdb.org/t/p/original//2BkcMxgEq7i5x69Q6w77JeEewWr.jpg', 'https://image.tmdb.org/t/p/original//3PEAkZHa8ehfUkuKbzmQNRTTAAs.jpg', 'Lloyd and Harry are two men whose stupidity is really indescribable. When Mary, a beautiful woman, loses an important suitcase with money before she leaves for Aspen, the two friends (who have found the suitcase) decide to return it to her. After some \"adventures\" they finally get to Aspen where, using the lost money they live it up and fight for Mary\'s heart.', '', '1994-12-16', '01:47:00', 7, 40.673, 0),
(10195, 'Thor', 'https://image.tmdb.org/t/p/original//LvmmDZxkTDqp0DX7mUo621ahdX.jpg', 'https://image.tmdb.org/t/p/original//bIuOWTtyFPjsFDevqvF3QrD1aun.jpg', 'Against his father Odin\'s will, The Mighty Thor - a powerful but arrogant warrior god - recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.', '', '2011-04-21', '01:55:00', 7, 38.447, 0),
(11683, 'Land of the Dead', 'https://image.tmdb.org/t/p/original//auPv1B8wVHnDn9ypAxeit44CFMN.jpg', 'https://image.tmdb.org/t/p/original//1VYvkSiyJg9Za2R5KSHjUygLKEq.jpg', 'The world is full of zombies and the survivors have barricaded themselves inside a walled city to keep out the living dead. As the wealthy hide out in skyscrapers and chaos rules the streets, the rest of the survivors must find a way to stop the evolving zombies from breaking into the city.', '', '2005-06-24', '01:33:00', 6, 43.624, 0),
(17610, 'NCIS: Los Angeles', 'https://image.tmdb.org/t/p/original//dQ8xZxtZtZTq74RjTycO1RKoqi0.jpg', 'https://image.tmdb.org/t/p/original//YuY3IbeLnTYxJJ3PruZ6gl3LqK.jpg', 'The exploits of the Los Angelesâ€“based Office of Special Projects (OSP), an elite division of the Naval Criminal Investigative Service that specializes in undercover assignments.', '0', '2009-09-22', '00:00:00', 7, 41.392, 1),
(18165, 'The Vampire Diaries', 'https://image.tmdb.org/t/p/original//3O4r2guye3WwLBNPTfpfecU1FBn.jpg', 'https://image.tmdb.org/t/p/original//vfF7IiyTar1ngfsd6n13LgFn9MD.jpg', 'The story of two vampire brothers obsessed with the same girl, who bears a striking resemblance to the beautiful but ruthless vampire they knew and loved in 1864.', '0', '2009-09-10', '00:00:00', 7, 44.975, 1),
(24428, 'The Avengers', 'https://image.tmdb.org/t/p/original//hbn46fQaRmlpBuUrEiFqv0GDL6Y.jpg', 'https://image.tmdb.org/t/p/original//cezWGskPY5x7GaglTTRN4Fugfb8.jpg', 'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!', '', '2012-04-25', '02:23:00', 7.75, 44.219, 0),
(31917, 'Pretty Little Liars', 'https://image.tmdb.org/t/p/original//rQGBjWNveVeF8f2PGRtS85w9o9r.jpg', 'https://image.tmdb.org/t/p/original//aUPbHiLS3hCHKjtLsncFa9g0viV.jpg', 'Based on the Pretty Little Liars series of young adult novels by Sara Shepard, the series follows the lives of four girls â€” Spencer, Hanna, Aria, and Emily â€” whose clique falls apart after the disappearance of their queen bee, Alison. One year later, they begin receiving messages from someone using the name \"A\" who threatens to expose their secrets â€” including long-hidden ones they thought only Alison knew.', '0', '2010-06-08', '00:00:00', 6, 43.985, 1),
(32798, 'Hawaii Five-0', 'https://image.tmdb.org/t/p/original//mAXpHFDTMHvJt7WdibFWdbRsdCG.jpg', 'https://image.tmdb.org/t/p/original//y8QtBv7nyS2Auo0PNNgX9Hrh1Uz.jpg', 'Steve McGarrett returns home to Oahu, in order to find his father\'s killer. The governor offers him the chance to run his own task force (Five-0). Steve\'s team is joined by Chin Ho Kelly, Danny \"Danno\" Williams, and Kono Kalakaua.', '0', '2010-09-20', '00:00:00', 6, 40.189, 1),
(34307, 'Shameless', 'https://image.tmdb.org/t/p/original//zjOj2gnDJYFdYt6R7FtuHn7yrPr.jpg', 'https://image.tmdb.org/t/p/original//iRyQTp2L437k6zfFCvZSOWaxQFA.jpg', 'Chicagoan Frank Gallagher is the proud single dad of six smart, industrious, independent kids, who without him would be... perhaps better off. When Frank\'s not at the bar spending what little money they have, he\'s passed out on the floor. But the kids have found ways to grow up in spite of him. They may not be like any family you know, but they make no apologies for being exactly who they are.', '0', '2011-01-09', '00:00:00', 8, 47.516, 1),
(34524, 'Teen Wolf', 'https://image.tmdb.org/t/p/original//swHKfpG1vj4fuBtix8jUc16ao9z.jpg', 'https://image.tmdb.org/t/p/original//vY2vfAskJTiWsQSv6bdbNCQhPLm.jpg', 'Scott McCall, a high school student living in the town of Beacon Hills has his life drastically changed when he\'s bitten by a werewolf, becoming one himself. He must henceforth learn to balance his problematic new identity with his day-to-day teenage life. The following characters are instrumental to his struggle: Stiles, his best friend; Allison, his love interest who comes from a family of werewolf hunters; and Derek, a mysterious werewolf with a dark past. Throughout the series, he strives to keep his loved ones safe while maintaining normal relationships with them.', '0', '2011-06-05', '00:00:00', 7, 43.679, 1),
(37680, 'Suits', 'https://image.tmdb.org/t/p/original//7gRvLvHH78YAdchOghNpH2EysJ2.jpg', 'https://image.tmdb.org/t/p/original//nVz7cZZ59PsCLgiWFC0M0N6AFC3.jpg', 'While running from a drug deal gone bad, Mike Ross, a brilliant young college-dropout, slips into a job interview with one of New York City\'s best legal closers, Harvey Specter. Tired of cookie-cutter law school grads, Harvey takes a gamble by hiring Mike on the spot after he recognizes his raw talent and photographic memory. Mike and Harvey are a winning team. Even though Mike is a genius, he still has a lot to learn about law. And while Harvey may seem like an emotionless, cold-blooded shark, Mike\'s sympathy and concern for their cases and clients will help remind Harvey why he went into law in the first place. Mike\'s other allies in the office include the firm\'s best paralegal Rachel and Harvey\'s no-nonsense assistant Donna to help him serve justice. Proving to be an irrepressible duo and invaluable to the practice, Mike and Harvey must keep their secret from everyone including managing partner Jessica and Harvey\'s arch nemesis Louis, who seems intent on making Mike\'s life as difficult as possible.', '0', '2011-06-23', '00:00:00', 8, 53.569, 1),
(39272, 'Once Upon a Time', 'https://image.tmdb.org/t/p/original//Otzq1sny6BAuvZdAO1EMdUkDUc.jpg', 'https://image.tmdb.org/t/p/original//49qD372jeHUTmdNMGJkjCFZdv9y.jpg', 'There is a town in Maine where every story book character you\'ve ever known is trapped between two worlds, victims of a powerful curse. Only one knows the truth and only one can break the spell.\n\nEmma Swan is a 28-year-old bail bonds collector who has been supporting herself since she was abandoned as a baby. Things change for her when her son Henry, whom she abandoned years ago, finds her and asks for her help explaining that she is from a different world where she is Snow White\'s missing daughter.', '0', '2011-10-23', '00:00:00', 6, 41.851, 1),
(44217, 'Vikings', 'https://image.tmdb.org/t/p/original//A30ZqEoDbchvE7mCZcSp6TEwB1Q.jpg', 'https://image.tmdb.org/t/p/original//oktTNFM8PzdseiK1X0E0XhB6LvP.jpg', 'Vikings follows the adventures of Ragnar Lothbrok, the greatest hero of his age. The series tells the sagas of Ragnar\'s band of Viking brothers and his family, as he rises to become King of the Viking tribes. As well as being a fearless warrior, Ragnar embodies the Norse traditions of devotion to the gods. Legend has it that he was a direct descendant of Odin, the god of war and warriors.', '0', '2013-03-03', '00:00:00', 8, 52.188, 1),
(44953, 'The Lord of the Skies', 'https://image.tmdb.org/t/p/original//qsTlD6rYb5vXOlBTT9Lj2hBp44X.jpg', 'https://image.tmdb.org/t/p/original//bGnkIvPsnDquv9EE11S7PTvSeZm.jpg', 'Set in the 1990s, these are the life and times of Amado Carrillo Fuentes, a man who became the head of the JuÃ¡rez cartel. Nicknamed â€œEl SeÃ±or de los Cielosâ€ (Lord of the Skies) because of the large fleet of airplanes he used to transport drugs, he was also known for washing more than $200 million through Colombia to finance his huge fleet. He is described as the most powerful drug trafficker of his time.', '0', '2013-04-15', '00:00:00', 5, 51.994, 1),
(46896, 'The Originals', 'https://image.tmdb.org/t/p/original//7crHhmTybBvGQ3Y96j4kdQ89ldY.jpg', 'https://image.tmdb.org/t/p/original//2llbXc2BOkLkBGgcNJCRbrWedUO.jpg', 'A spin-off from The Vampire Diaries and set in New Orleans, The Originals centers on the Mikaelson siblings, otherwise known as the world\'s original vampires: Klaus, Elijah, and Rebekah. Now Klaus must take down his protÃ©gÃ©, Marcel, who is now in charge of New Orleans, in order to re-take his city, as he originally built New Orleans. Klaus departed from the city after being chased down by his father Mikael, while it was being constructed and Marcel took charge. As Klaus has returned after many years, his ego has provoked him to become the king of the city. \"Every King needs an heir\" says Klaus, accepting the unborn child. The child is a first to be born to a hybrid and a werewolf.', '0', '2013-10-03', '00:00:00', 7, 65.542, 1),
(46952, 'The Blacklist', 'https://image.tmdb.org/t/p/original//fHwiAqIKragaCbNJo9Qs4lrccIN.jpg', 'https://image.tmdb.org/t/p/original//bgbQCW4fE9b6wSOSC6Fb4FfVzsW.jpg', 'Raymond \"Red\" Reddington, one of the FBI\'s most wanted fugitives, surrenders in person at FBI Headquarters in Washington, D.C. He claims that he and the FBI have the same interests: bringing down dangerous criminals and terrorists. In the last two decades, he\'s made a list of criminals and terrorists that matter the most but the FBI cannot find because it does not know they exist. Reddington calls this \"The Blacklist\". Reddington will co-operate, but insists that he will speak only to Elizabeth Keen, a rookie FBI profiler.', '0', '2013-09-23', '00:00:00', 7, 41.121, 1),
(48866, 'The 100', 'https://image.tmdb.org/t/p/original//qYTIuJJ7fIehicAt3bl0vW70Sq6.jpg', 'https://image.tmdb.org/t/p/original//wHIMMLFsk32wIzDmawWkYVbxFCS.jpg', 'Based on the books by Kass Morgan, this show takes place 100 years in the future, when the Earth has been abandoned due to radioactivity. The last surviving humans live on an ark orbiting the planet â€” but the ark won\'t last forever. So the repressive regime picks 100 expendable juvenile delinquents to send down to Earth to see if the planet is still habitable.', '0', '2014-03-19', '00:00:00', 6, 140.843, 1),
(57243, 'Doctor Who', 'https://image.tmdb.org/t/p/original//tQkigP2fItdzJWvtIhBvHxgs5yE.jpg', 'https://image.tmdb.org/t/p/original//3EcYZhBMAvVw4czcDLg9Sd0FuzQ.jpg', 'The Doctor looks and seems human. He\'s handsome, witty, and could be mistaken for just another man in the street. But he is a Time Lord: a 900 year old alien with 2 hearts, part of a gifted civilization who mastered time travel. The Doctor saves planets for a living â€“ more of a hobby actually, and he\'s very, very good at it. He\'s saved us from alien menaces and evil from before time began â€“ but just who is he?', '0', '2005-03-26', '00:00:00', 7, 60.001, 1),
(60572, 'PokÃ©mon', 'https://image.tmdb.org/t/p/original//uxBFkJNwp9DEIE7k6YhKAorVpkp.jpg', 'https://image.tmdb.org/t/p/original//2pcTUs20ysCdA6DZclaPmGXD6ph.jpg', 'Join Ash Ketchum, accompanied by his partner Pikachu, as he travels through many regions, meets new friends and faces new challenges on his quest to become a PokÃ©mon Master.', '0', '1997-04-01', '00:00:00', 6, 41.828, 1),
(60708, 'Gotham', 'https://image.tmdb.org/t/p/original//mKBP1OCgCG0jw8DwVYlnYqVILtc.jpg', 'https://image.tmdb.org/t/p/original//5tSHzkJ1HBnyGdcpr6wSyw7jYnJ.jpg', 'Before there was Batman, there was GOTHAM. \n\nEveryone knows the name Commissioner Gordon. He is one of the crime world\'s greatest foes, a man whose reputation is synonymous with law and order. But what is known of Gordon\'s story and his rise from rookie detective to Police Commissioner? What did it take to navigate the multiple layers of corruption that secretly ruled Gotham City, the spawning ground of the world\'s most iconic villains? And what circumstances created them â€“ the larger-than-life personas who would become Catwoman, The Penguin, The Riddler, Two-Face and The Joker? ', '0', '2014-09-22', '00:00:00', 7, 50.478, 1),
(60735, 'The Flash', 'https://image.tmdb.org/t/p/original//mmxxEpTqVdwBlu5Pii7tbedBkPC.jpg', 'https://image.tmdb.org/t/p/original//lUFK7ElGCk9kVEryDJHICeNdmd1.jpg', 'After a particle accelerator causes a freak storm, CSI Investigator Barry Allen is struck by lightning and falls into a coma. Months later he awakens with the power of super speed, granting him the ability to move through Central City like an unseen guardian angel. Though initially excited by his newfound powers, Barry is shocked to discover he is not the only \"meta-human\" who was created in the wake of the accelerator explosion -- and not everyone is using their new powers for good. Barry partners with S.T.A.R. Labs and dedicates his life to protect the innocent. For now, only a few close friends and associates know that Barry is literally the fastest man alive, but it won\'t be long before the world learns what Barry Allen has become...The Flash.', '0', '2014-10-07', '00:00:00', 7, 58.103, 1),
(61555, 'The Missing', 'https://image.tmdb.org/t/p/original//2hF2RnjVwHvxfhH2lkB9H9FdQHb.jpg', 'https://image.tmdb.org/t/p/original//w1FDeOGoFS1qsSRHlj2Jzp2P0e1.jpg', 'A gripping anthological relationship thriller series exploring the emotional fallout of a child\'s abduction not only on the family but on the wider community, told over two time frames.', '0', '2014-10-28', '00:00:00', 7, 68.152, 1),
(62127, 'Marvel\'s Iron Fist', 'https://image.tmdb.org/t/p/original//xHCfWGlxwbtMeeOnTvxUCZRGnkk.jpg', 'https://image.tmdb.org/t/p/original//nv4nLXbDhcISPP8C1mgaxKU50KO.jpg', 'Danny Rand resurfaces 15 years after being presumed dead. Now, with the power of the Iron Fist, he seeks to reclaim his past and fulfill his destiny.', '0', '2017-03-17', '00:00:00', 6, 56.461, 1),
(62688, 'Supergirl', 'https://image.tmdb.org/t/p/original//2qou2R47XZ1N6SlqGZcoCHDyEhN.jpg', 'https://image.tmdb.org/t/p/original//ufoGrTRbItHvqk42yNHcyoE0afM.jpg', 'Twenty-four-year-old Kara Zor-El, who was taken in by the Danvers family when she was 13 after being sent away from Krypton, must learn to embrace her powers after previously hiding them. The Danvers teach her to be careful with her powers, until she has to reveal them during an unexpected disaster, setting her on her journey of heroism.', '0', '2015-10-26', '00:00:00', 6, 45.753, 1),
(63174, 'Lucifer', 'https://image.tmdb.org/t/p/original//6kZCuvbirx6ibJfaWqwV2p90yPI.jpg', 'https://image.tmdb.org/t/p/original//wmOuYyqVaczBLXxQNFSaRfAUgPz.jpg', 'Bored and unhappy as the Lord of Hell, Lucifer Morningstar abandoned his throne and retired to Los Angeles, where he has teamed up with LAPD detective Chloe Decker to take down criminals.Â But the longer he\'s away from the underworld, the greater the threat that the worst of humanity could escape.', '0', '2016-01-25', '00:00:00', 7, 41.279, 1),
(63247, 'Westworld', 'https://image.tmdb.org/t/p/original//yp94aOXzuqcQHva90B3jxLfnOO9.jpg', 'https://image.tmdb.org/t/p/original//6aj09UTMQNyfSfk0ZX8rYOEsXL2.jpg', 'A dark odyssey about the dawn of artificial consciousness and the evolution of sin. Set at the intersection of the near future and the reimagined past, it explores a world in which every human appetite, no matter how noble or depraved, can be indulged.', '0', '2016-10-02', '00:00:00', 8, 46.025, 1),
(63639, 'The Expanse', 'https://image.tmdb.org/t/p/original//beIjmWr3OBOtcWK4tKMObOIDJ1C.jpg', 'https://image.tmdb.org/t/p/original//prJFWxJ0x8tBPTliMjj51wgYnSK.jpg', 'A thriller set two hundred years in the future following the case of a missing young woman who brings a hardened detective and a rogue ship\'s captain together in a race across the solar system to expose the greatest conspiracy in human history.', '0', '2015-12-14', '00:00:00', 8, 44.999, 1),
(66857, 'Shooter', 'https://image.tmdb.org/t/p/original//wLq6GiuzpmLozY6EfPzWdocB2bg.jpg', 'https://image.tmdb.org/t/p/original//oMmqtafm6Rdlka1ejJeC9BDWzyO.jpg', 'Bob Lee Swagger is an expert marksman living in exile who is coaxed back into action after learning of a plot to kill the president. Based on the best-selling Bob Lee Swagger novel by Stephen Hunter, Point of Impact, and the 2007 Paramount film starring Mark Wahlberg.', '0', '2016-11-15', '00:00:00', 7, 39.241, 1),
(67744, 'Mindhunter', 'https://image.tmdb.org/t/p/original//a906PH7CDmSOdS7kmnAgdWk5mhv.jpg', 'https://image.tmdb.org/t/p/original//r7RIwuceOaDP4KTmU1EFeDniRq4.jpg', 'An agent in the FBI\'s Elite Serial Crime Unit develops profiling techniques as he pursues notorious serial killers and rapists.', '0', '2017-10-13', '00:00:00', 7, 101.123, 1),
(69050, 'Riverdale', 'https://image.tmdb.org/t/p/original//2IUpoKSP64r6rp2vBo0Fdk8a1UU.jpg', 'https://image.tmdb.org/t/p/original//1TsbOTztAJtzTRXAhoLsX9a83XX.jpg', 'Set in the present, the series offers a bold, subversive take on Archie, Betty, Veronica and their friends, exploring the surreality of small-town life, the darkness and weirdness bubbling beneath Riverdaleâ€™s wholesome facade.', '0', '2017-01-26', '00:00:00', 7, 41.256, 1),
(69478, 'The Handmaid\'s Tale', 'https://image.tmdb.org/t/p/original//1lgss4ZTOsFgY0p9xRf4hl85BNR.jpg', 'https://image.tmdb.org/t/p/original//tELIZw0ugIxqjBKrhWbROlgCbz4.jpg', 'Set in a dystopian future, a woman is forced to live as a concubine under a fundamentalist theocratic dictatorship. A TV adaptation of Margaret Atwood\'s novel.', '0', '2017-04-26', '00:00:00', 8, 39.155, 1),
(70513, 'Salvation', 'https://image.tmdb.org/t/p/original//iWatl2zNjHbG1mDpzJIKCsNxDgr.jpg', 'https://image.tmdb.org/t/p/original//hXCd9FUT7ZjoB390cGioVhEiXOB.jpg', 'An MIT grad student and a tech superstar bring a low-level Pentagon official a staggering discovery that an asteroid is just six months away from colliding with Earth.', '0', '2017-07-12', '00:00:00', 7, 57.68, 1),
(71446, 'Money Heist', 'https://image.tmdb.org/t/p/original//flyWT9eIE8vdy1tzEGxBN4RkoeN.jpg', 'https://image.tmdb.org/t/p/original//2d0ESa56OesIFAOAl8ZZi0mHlxC.jpg', 'To carry out the biggest heist in history, a mysterious man called The Professor recruits a band of eight robbers who have a single characteristic: none of them has anything to lose. Five months of seclusion - memorizing every step, every detail, every probability - culminate in eleven days locked up in the National Coinage and Stamp Factory of Spain, surrounded by police forces and with dozens of hostages in their power, to find out whether their suicide wager will lead to everything or nothing.', '0', '2017-05-02', '00:00:00', 8, 40.568, 1),
(74564, 'Dupur Thakurpo', 'https://image.tmdb.org/t/p/original//dcnZkkbK6dQZx0PMEzsWuXNyYEC.jpg', 'https://image.tmdb.org/t/p/original//t9uo1UQY4NbFMievublkIFPtyRE.jpg', 'When Jibon Babu brings home a vivacious wife, Uma, inappropriate things start happening as she becomes the fantasy and obsession of the other young tenants in the house.', '0', '2017-10-08', '00:00:00', 0, 44.915, 1),
(100042, 'Dumb and Dumber To', 'https://image.tmdb.org/t/p/original//pMNSiNT55XrxWPmoI5ytJyinRa8.jpg', 'https://image.tmdb.org/t/p/original//Ekw3ijq9L6RiKvv5m2tPOEklHF.jpg', '20 years after the dimwits set out on their first adventure, they head out in search of one of their long lost children in the hope of gaining a new kidney.', '', '2014-11-12', '01:49:00', 5, 41.661, 0),
(102651, 'Maleficent', 'https://image.tmdb.org/t/p/original//tO4xw0P4mdia3EcS6pHkox3cOIy.jpg', 'https://image.tmdb.org/t/p/original//4FYu1AAu14tuBU0lns0hbKiHUcH.jpg', 'The untold story of Disney\'s most iconic villain from the 1959 classic \'Sleeping Beauty\'. A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land.  Maleficent rises to be the land\'s fiercest protector, but she ultimately suffers a ruthless betrayal â€“ an act that begins to turn her heart into stone. Bent on revenge, Maleficent faces an epic battle with the invading King\'s successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom - and to Maleficent\'s true happiness as well.', '', '2014-05-28', '01:37:00', 7, 68.247, 0),
(102899, 'Ant-Man', 'https://image.tmdb.org/t/p/original//kvXLZqY0Ngl1XSw7EaMQO0C1CCj.jpg', 'https://image.tmdb.org/t/p/original//D6e8RJf2qUstnfkTslTXNTUAlT.jpg', 'Armed with the astonishing ability to shrink in scale but increase in strength, master thief Scott Lang must embrace his inner-hero and help his mentor, Doctor Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.', '', '2015-07-14', '01:57:00', 7, 52.909, 0),
(118340, 'Guardians of the Galaxy', 'https://image.tmdb.org/t/p/original//bHarw8xrmQeqf3t8HpuMY7zoK4x.jpg', 'https://image.tmdb.org/t/p/original//y31QB9kn3XSudA15tV7UWQ9XLuW.jpg', 'Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.', '', '2014-07-30', '02:00:00', 8, 59.488, 0),
(135397, 'Jurassic World', 'https://image.tmdb.org/t/p/original//t5KONotASgVKq4N19RyhIthWOPG.jpg', 'https://image.tmdb.org/t/p/original//jjBgi2r5cRt36xF6iNUEhzscEcb.jpg', 'Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.', '', '2015-06-06', '02:04:00', 7, 48.95, 0),
(141052, 'Justice League', 'https://image.tmdb.org/t/p/original//o5T8rZxoWSBMYwjsUFUqTt6uMQB.jpg', 'https://image.tmdb.org/t/p/original//eifGNCSDuxJeS1loAXil5bIGgvC.jpg', 'Fuelled by his restored faith in humanity and inspired by Superman\'s selfless act, Bruce Wayne and Diana Prince assemble a team of metahumans consisting of Barry Allen, Arthur Curry and Victor Stone to face the catastrophic threat of Steppenwolf and the Parademons who are on the hunt for three Mother Boxes on Earth.', '', '2017-11-15', '02:00:00', 6, 56.28, 0),
(157336, 'Interstellar', 'https://image.tmdb.org/t/p/original//xu9zaAevzQ5nnrsXN6JcahLnG4i.jpg', 'https://image.tmdb.org/t/p/original//nBNZadXqJSdt05SHLqgT0HuC5Gm.jpg', 'Interstellar chronicles the adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.', '', '2014-11-05', '02:49:00', 8, 39.679, 0),
(157350, 'Divergent', 'https://image.tmdb.org/t/p/original//g6WT9zxATzTy9NVu2xwbxDAxvjd.jpg', 'https://image.tmdb.org/t/p/original//yTtx2ciqk4XdN1oKhMMDy3f5ue3.jpg', 'In a world divided into factions based on personality types, Tris learns that she\'s been classified as Divergent and won\'t fit in. When she discovers a plot to destroy Divergents, Tris and the mysterious Four must find out what makes Divergents dangerous before it\'s too late.', '', '2014-03-14', '02:19:00', 7, 54.714, 0),
(159824, 'Hotel Transylvania 2', 'https://image.tmdb.org/t/p/original//h3t4zZPteUPqyDBrmz5Z2zzGM61.jpg', 'https://image.tmdb.org/t/p/original//t4PLWexbe4wbNydCOBv18cYexup.jpg', 'When the old-old-old-fashioned vampire Vlad arrives at the hotel for an impromptu family get-together, Hotel Transylvania is in for a collision of supernatural old-school and modern day cool.', '', '2015-09-21', '01:29:00', 7, 76.464, 0),
(180894, 'Ninja: Shadow of a Tear', 'https://image.tmdb.org/t/p/original//qkhjHfXxZKD317GeifrepN9YJSt.jpg', 'https://image.tmdb.org/t/p/original//k5uuo4mvWHb80ePDZylN2xvcz7h.jpg', 'Fight everyone and trust no one: it\'s the code of survival practiced by martial-arts master Casey Bowman after his life of domestic bliss is shattered by a savage act of violence. Vowing revenge, the fearless American stealthily tracks the killer from Osaka to Bangkok to Rangoon with the help of a wise and crafty sensei. His only clues: a series of victims whose necks bear the distinctive mark of strangulation by barbed wire. Fighting to avenge as well as to survive, Casey must sharpen his razor-like responses and take his battle skills to the next level, even using deep meditation to fake his own death. His target: the sinister drug lord Goro, who is flooding the streets with deadly meth cooked at his remote jungle factory. To prepare for his ultimate confrontation, Casey must finally become an invisible warrior worthy of the name Ninja. But just when his prey is cornered, an unexpected twist shows Casey that his battle is only beginning: he truly can trust no one.', '', '2013-12-27', '01:34:00', 6, 42.036, 0),
(181808, 'Star Wars: The Last Jedi', 'https://image.tmdb.org/t/p/original//oVdLj5JVqNWGY0LEhBfHUuMrvWJ.jpg', 'https://image.tmdb.org/t/p/original//kOVEVeg59E0wsnXmF9nrh6OmWII.jpg', 'Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares to do battle with the First Order.', '', '2017-12-13', '02:31:00', 7, 66.43, 0),
(198663, 'The Maze Runner', 'https://image.tmdb.org/t/p/original//lkOZcsXcOLZYeJ2YxJd3vSldvU4.jpg', 'https://image.tmdb.org/t/p/original//coss7RgL0NH6g4fC2s5atvf3dFO.jpg', 'Set in a post-apocalyptic world, young Thomas is deposited in a community of boys after his memory is erased, soon learning they\'re all trapped in a maze that will require him to join forces with fellow â€œrunnersâ€ for a shot at escape.', '', '2014-09-10', '01:53:00', 7, 42.755, 0),
(209112, 'Batman v Superman: Dawn of Justice', 'https://image.tmdb.org/t/p/original//vsjBeMPZtyB7yNsYY56XYxifaQZ.jpg', 'https://image.tmdb.org/t/p/original//cGOPbv9wA5gEejkUN892JrveARt.jpg', 'Fearing the actions of a god-like Super Hero left unchecked, Gotham Cityâ€™s own formidable, forceful vigilante takes on Metropolisâ€™s most revered, modern-day savior, while the world wrestles with what sort of hero it really needs. And with Batman and Superman at war with one another, a new threat quickly arises, putting mankind in greater danger than itâ€™s ever known before.', '', '2016-03-23', '02:30:00', 6, 41.73, 0),
(241259, 'Alice Through the Looking Glass', 'https://image.tmdb.org/t/p/original//fAIIEyPuO6eJmXqb3XVXEx6SNjn.jpg', 'https://image.tmdb.org/t/p/original//7rfucKCjV01OEsGr9grXa34Aywd.jpg', 'In the sequel to Tim Burton\'s \"Alice in Wonderland\", Alice Kingsleigh returns to Underland and faces a new adventure in saving the Mad Hatter.', '', '2016-05-25', '01:53:00', 7, 46.525, 0),
(263115, 'Logan', 'https://image.tmdb.org/t/p/original//5pAGnkFYSsFJ99ZxDIYnhQbQFXs.jpg', 'https://image.tmdb.org/t/p/original//gGBu0hKw9BGddG8RkRAMX7B6NDB.jpg', 'In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan\'s attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.', '', '2017-02-28', '02:16:00', 7.5, 47.963, 0),
(268896, 'Pacific Rim: Uprising', 'https://image.tmdb.org/t/p/original//6pT73ACl5N1VekdK3wQI8PLfz1E.jpg', 'https://image.tmdb.org/t/p/original//v5HlmJK9bdeHxN2QhaFP1ivjX3U.jpg', 'It has been ten years since The Battle of the Breach and the oceans are still, but restless. Vindicated by the victory at the Breach, the Jaeger program has evolved into the most powerful global defense force in human history. The PPDC now calls upon the best and brightest to rise up and become the next generation of heroes when the Kaiju threat returns.', '', '2018-03-21', '01:51:00', 6, 59.293, 0),
(274855, 'Geostorm', 'https://image.tmdb.org/t/p/original//79X8JkGxzc1tJMi0KxUSaPLooVg.jpg', 'https://image.tmdb.org/t/p/original//nrsx0jEaBgXq4PWo7SooSnYJTv.jpg', 'After an unprecedented series of natural disasters threatened the planet, the world\'s leaders came together to create an intricate network of satellites to control the global climate and keep everyone safe. But now, something has gone wrong: the system built to protect Earth is attacking it, and it becomes a race against the clock to uncover the real threat before a worldwide geostorm wipes out everything and everyone along with it.', '', '2017-10-13', '01:49:00', 6, 40.738, 0),
(281338, 'War for the Planet of the Apes', 'https://image.tmdb.org/t/p/original//ulMscezy9YX0bhknvJbZoUgQxO5.jpg', 'https://image.tmdb.org/t/p/original//oDvgC7IeTdc03SgiSSo2HY7xGYX.jpg', 'Caesar and his apes are forced into a deadly conflict with an army of humans led by a ruthless Colonel. After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind. As the journey finally brings them face to face, Caesar and the Colonel are pitted against each other in an epic battle that will determine the fate of both their species and the future of the planet.', '', '2017-07-11', '02:20:00', 7, 52.711, 0),
(283995, 'Guardians of the Galaxy Vol. 2', 'https://image.tmdb.org/t/p/original//aJn9XeesqsrSLKcHfHP4u5985hn.jpg', 'https://image.tmdb.org/t/p/original//y4MBh0EjBlMuOzv9axM4qJlmhzz.jpg', 'The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill\'s true parentage.', '', '2017-04-19', '02:16:00', 8, 37.897, 0),
(284054, 'Black Panther', 'https://image.tmdb.org/t/p/original//b6ZJZHUdMEFECvGiDpJjlfUWela.jpg', 'https://image.tmdb.org/t/p/original//uxzzxijgPIY7slzFvMotPv8wjKA.jpg', 'King T\'Challa returns home from America to the reclusive, technologically advanced African nation of Wakanda to serve as his country\'s new leader. However, T\'Challa soon finds that he is challenged for the throne by factions within his own country as well as without. Using powers reserved to Wakandan kings, T\'Challa assumes the Black Panther mantel to join with girlfriend Nakia, the queen-mother, his princess-kid sister, members of the Dora Milaje (the Wakandan \'special forces\') and an American secret agent, to prevent Wakanda from being dragged into a world war.', '', '2018-02-13', '02:14:00', 7, 76.979, 0),
(297762, 'Wonder Woman', 'https://image.tmdb.org/t/p/original//6iUNJZymJBMXXriQyFZfLAKnjO6.jpg', 'https://image.tmdb.org/t/p/original//imekS7f1OuHyUP2LAiTEM0zBzUz.jpg', 'An Amazon princess comes to the world of Man in the grips of the First World War to confront the forces of evil and bring an end to human conflict.', '', '2017-05-30', '02:21:00', 7, 41.248, 0),
(316727, 'The Purge: Election Year', 'https://image.tmdb.org/t/p/original//lPhsKTtycmbp6bzJAG662Pd5U3N.jpg', 'https://image.tmdb.org/t/p/original//bjOJFjUffRZQpNQ9g3yvc9F6LBM.jpg', 'Two years after choosing not to kill the man who killed his son, former police sergeant Leo Barnes has become head of security for Senator Charlene Roan, the front runner in the next Presidential election due to her vow to eliminate the Purge. On the night of what should be the final Purge, a betrayal from within the government forces Barnes and Roan out onto the street where they must fight to survive the night.', '', '2016-06-29', '01:45:00', 6, 54.198, 0),
(335984, 'Blade Runner 2049', 'https://image.tmdb.org/t/p/original//mVr0UiqyltcfqxbAUcLl9zWL8ah.jpg', 'https://image.tmdb.org/t/p/original//gajva2L0rPYkEWjzgFlBXCAVBE5.jpg', 'Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what\'s left of society into chaos. K\'s discovery leads him on a quest to find Rick Deckard, a former LAPD blade runner who has been missing for 30 years.', '', '2017-10-04', '02:43:00', 7, 51.231, 0),
(336843, 'Maze Runner: The Death Cure', 'https://image.tmdb.org/t/p/original//bvbyidkMaBls1LTaIWYY6UmYTaL.jpg', 'https://image.tmdb.org/t/p/original//7GgZ6DGezkh3szFdvskH5XD4V0t.jpg', 'Thomas leads his group of escaped Gladers on their final and most dangerous mission yet. To save their friends, they must break into the legendary Last City, a WCKD-controlled labyrinth that may turn out to be the deadliest maze of all. Anyone who makes it out alive will get answers to the questions the Gladers have been asking since they first arrived in the maze.', '', '2018-01-10', '02:23:00', 7, 40.609, 0);
INSERT INTO `movie` (`id`, `name`, `cover`, `thumbnail`, `synopsis`, `parentsGuide`, `releaseDate`, `length`, `rating`, `popularity`, `isTvSeries`) VALUES
(337167, 'Fifty Shades Freed', 'https://image.tmdb.org/t/p/original//9ywA15OAiwjSTvg3cBs9B7kOCBF.jpg', 'https://image.tmdb.org/t/p/original//jjPJ4s3DWZZvI4vw8Xfi4Vqa1Q8.jpg', 'Believing they have left behind shadowy figures from their past, newlyweds Christian and Ana fully embrace an inextricable connection and shared life of luxury. But just as she steps into her role as Mrs. Grey and he relaxes into an unfamiliar stability, new threats could jeopardize their happy ending before it even begins.', '', '2018-01-17', '01:45:00', 6, 59.614, 0),
(337339, 'The Fate of the Furious', 'https://image.tmdb.org/t/p/original//jzdnhRhG0dsuYorwvSqPqqnM1cV.jpg', 'https://image.tmdb.org/t/p/original//dImWM7GJqryWJO9LHa3XQ8DD5NH.jpg', 'When a mysterious woman seduces Dom into the world of crime and a betrayal of those closest to him, the crew face trials that will test them as never before.', '', '2017-04-12', '02:15:00', 7, 38.189, 0),
(338970, 'Tomb Raider', 'https://image.tmdb.org/t/p/original//bLJTjfbZ1c5zSNiAvGYs1Uc82ir.jpg', 'https://image.tmdb.org/t/p/original//3zrC5tUiR35rTz9stuIxnU1nUS5.jpg', 'Lara Croft, the fiercely independent daughter of a missing adventurer, must push herself beyond her limits when she finds herself on the island where her father disappeared.', '', '2018-03-05', '01:57:00', 6, 55.796, 0),
(340022, 'Gringo', 'https://image.tmdb.org/t/p/original//1u2f04uoVGTjmThK71yDDqeQwK0.jpg', 'https://image.tmdb.org/t/p/original//dxeVPklFwng2IowqRPNI4od6aXv.jpg', 'An American businessman with a stake in a pharmaceutical company that\'s about to go public finds his life is thrown into turmoil by an incident in Mexico.', '', '2018-03-08', '01:49:00', 6, 39.102, 0),
(343111, 'Aage Ki Soch', 'https://image.tmdb.org/t/p/original//rmQszCUBlCeqdtFWTWhGqGTlBW1.jpg', 'https://image.tmdb.org/t/p/original//qSJ0j8PQrhEzmd7jlwpxS4liQI7.jpg', 'Aage Ki Soch is 1988 Hindi language movie directed by Dada Kondke and starring Shakti Kapoor, Dada Kondke, Swapna, Raza Murad, and Satish Shah', '', '1988-01-01', '02:16:00', 3, 39.321, 0),
(345887, 'The Equalizer 2', 'https://image.tmdb.org/t/p/original//a24i4Qw6qFTtkFLQsncv8WPwevj.jpg', 'https://image.tmdb.org/t/p/original//cQvc9N6JiMVKqol3wcYrGshsIdZ.jpg', 'Robert McCall returns to deliver his special brand of vigilante justice -- but how far will he go when it\'s someone he loves?', '', '2018-07-19', '02:00:00', 6.5, 47.727, 0),
(347882, 'Sleight', 'https://image.tmdb.org/t/p/original//2SEgJ0mHJ7TSdVDbkGU061tR33K.jpg', 'https://image.tmdb.org/t/p/original//wridRvGxDqGldhzAIh3IcZhHT5F.jpg', 'A young street magician is left to take care of his little sister after his mother\'s passing and turns to drug dealing in the Los Angeles party scene to keep a roof over their heads. When he gets into trouble with his supplier, his sister is kidnapped and he is forced to rely on both his sleight of hand and brilliant mind to save her.', '', '2017-04-28', '01:29:00', 5, 41.915, 0),
(375098, 'The Show', 'https://image.tmdb.org/t/p/original//A4pEYA8zDqIHBf4nEHP9TbPzTou.jpg', 'https://image.tmdb.org/t/p/original//oe0WzIcsCfwYLu5WhHKOjXO4aYx.jpg', 'An unsettling look at reality television, where a disturbing game show has its contestants ending their lives for the public\'s enjoyment.', '', '2017-09-21', '01:44:00', 6, 45.694, 0),
(381288, 'Split', 'https://image.tmdb.org/t/p/original//4G6FNNLSIVrwSRZyFs91hQ3lZtD.jpg', 'https://image.tmdb.org/t/p/original//rXMWOZiCt6eMX22jWuTOSdQ98bY.jpg', 'Though Kevin has evidenced 23 personalities to his trusted psychiatrist, Dr. Fletcher, there remains one still submerged who is set to materialize and dominate all the others. Compelled to abduct three teenage girls led by the willful, observant Casey, Kevin reaches a war for survival among all of those contained within him â€” as well as everyone around him â€” as the walls between his compartments shatter apart.', '', '2017-01-19', '01:57:00', 7, 43.767, 0),
(396371, 'Molly\'s Game', 'https://image.tmdb.org/t/p/original//yvbXGWjg30sj7rohEZvSe90jSJC.jpg', 'https://image.tmdb.org/t/p/original//h9hUP5ZJGsjL2wbERrGlj4dMjZq.jpg', 'Molly Bloom, a young skier and former Olympic hopeful becomes a successful entrepreneur (and a target of an FBI investigation) when she establishes a high-stakes, international poker game.', '', '2017-12-21', '02:20:00', 7, 46.726, 0),
(399055, 'The Shape of Water', 'https://image.tmdb.org/t/p/original//hVYhrKuQNFro6jXHZMn60uYjrIP.jpg', 'https://image.tmdb.org/t/p/original//k4FwHlMhuRR5BISY2Gm2QZHlH5Q.jpg', 'An other-worldly story, set against the backdrop of Cold War era America circa 1962, where a mute janitor working at a lab falls in love with an amphibious man being held captive there and devises a plan to help him escape.', '', '2017-12-01', '02:02:00', 7, 45.457, 0),
(400155, 'Hotel Transylvania 3: Summer Vacation', 'https://image.tmdb.org/t/p/original//m03jul0YdVEOFXEQVUv6pOVQYGL.jpg', 'https://image.tmdb.org/t/p/original//gjAFM4xhA5vyLxxKMz38ujlUfDL.jpg', 'Dracula, Mavis, Johnny and the rest of the Drac Pack take a vacation on a luxury Monster Cruise Ship, where Dracula falls in love with the ship\'s captain, Ericka, who\'s secretly a descendant of Abraham Van Helsing, the notorious monster slayer.', '', '2018-06-30', '01:37:00', 7, 51.587, 0),
(400579, 'Tully', 'https://image.tmdb.org/t/p/original//h4Z6IUpTyD9ViV7NLmbAEbgM1G0.jpg', 'https://image.tmdb.org/t/p/original//wDI4YXBXolMYi15Qx2kClvdSERM.jpg', 'Marlo, a mother of three including a newborn, is gifted a night nanny by her brother. Hesitant to the extravagance at first, Marlo comes to form a bond with the thoughtful, surprising, and sometimes challenging nanny named Tully.', '', '2018-05-04', '01:36:00', 7, 69.618, 0),
(401981, 'Red Sparrow', 'https://image.tmdb.org/t/p/original//sGzuQYSTwJvLBc2PnuSVLHhuFeh.jpg', 'https://image.tmdb.org/t/p/original//vLCogyfQGxVLDC1gqUdNAIkc29L.jpg', 'Prima ballerina, Dominika Egorova faces a bleak and uncertain future after she suffers an injury that ends her career. She soon turns to Sparrow School, a secret intelligence service that trains exceptional young people to use their minds and bodies as weapons. Dominika emerges as the most dangerous Sparrow after completing the sadistic training process. As she comes to terms with her new abilities, she meets a CIA agent who tries to convince her that he is the only person she can trust.', '', '2018-02-28', '02:20:00', 6, 38.407, 0),
(406990, 'What Happened to Monday', 'https://image.tmdb.org/t/p/original//wwZ2uXOwPkMrZSeFn9s7WFXEMg6.jpg', 'https://image.tmdb.org/t/p/original//o6EsOqITcSzcdwD1zxBM9imdxjr.jpg', 'In a world where families are limited to one child due to overpopulation, a set of identical septuplets must avoid being put to a long sleep by the government and dangerous infighting while investigating the disappearance of one of their own.', '', '2017-08-18', '02:02:00', 7, 49.223, 0),
(427641, 'Rampage', 'https://image.tmdb.org/t/p/original//wrqUiMXttHE4UBFMhLHlN601MZh.jpg', 'https://image.tmdb.org/t/p/original//3gIO6mCd4Q4PF1tuwcyI3sjFrtI.jpg', 'Primatologist Davis Okoye shares an unshakable bond with George, the extraordinarily intelligent, silverback gorilla who has been in his care since birth.  But a rogue genetic experiment gone awry mutates this gentle ape into a raging creature of enormous size.  To make matters worse, itâ€™s soon discovered there are other similarly altered animals.  As these newly created alpha predators tear across North America, destroying everything in their path, Okoye teams with a discredited genetic engineer to secure an antidote, fighting his way through an ever-changing battlefield, not only to halt a global catastrophe but to save the fearsome creature that was once his friend.', '', '2018-04-12', '01:47:00', 7.85938, 78.597, 0),
(429417, 'Ghost Stories', 'https://image.tmdb.org/t/p/original//7vyzEMfcEpBChEyK7cP6XW6B7hi.jpg', 'https://image.tmdb.org/t/p/original//7a0sai9k5jr7YJRP5S3YIDErMVY.jpg', 'Arch sceptic Professor Phillip Goodman embarks upon a terror filled quest when he stumbles across a long-lost file containing details of three cases of inexplicable \'hauntings\'.', '', '2018-04-06', '01:38:00', 7, 71.358, 0),
(437033, 'Toc Toc', 'https://image.tmdb.org/t/p/original//oA4n3fCEW86QoLTDDlAfik9eOq9.jpg', 'https://image.tmdb.org/t/p/original//1D44oDrIVPSFzCB6Kb87pIfdWBz.jpg', 'Toc Toc is a 2017 Spanish comedy film directed by Vicente Villanueva. The movie follows the adventures and misadventures of a group of patients with OCD dated at the same time.', '', '2017-09-01', '01:30:00', 7, 62.238, 0),
(447200, 'Skyscraper', 'https://image.tmdb.org/t/p/original//oMKFQmoVgB69fyXfSMu0lGlHJP2.jpg', 'https://image.tmdb.org/t/p/original//3NL1FiTEhU4SWOuWk8lkVCbmnYm.jpg', 'Framed and on the run, a former FBI agent must save his family from a blazing fire in the world\'s tallest building.', '', '2018-07-11', '01:42:00', 6, 55.843, 0),
(447332, 'A Quiet Place', 'https://image.tmdb.org/t/p/original//tZmr0ozxSc2GasRuddtlRkf7f68.jpg', 'https://image.tmdb.org/t/p/original//nAU74GmpUk7t5iklEp3bufwDq4n.jpg', 'A family is forced to live in silence while hiding from creatures that hunt by sound.', '', '2018-04-03', '01:30:00', 7, 76.659, 0),
(454619, 'Overboard', 'https://image.tmdb.org/t/p/original//1c9UOyJP0FnhhdNoEvhI3ODcE3i.jpg', 'https://image.tmdb.org/t/p/original//qauHzSQJdo9VYX4NKn9PdWnvXOV.jpg', 'A spoiled, wealthy yacht owner is thrown overboard and becomes the target of revenge from his mistreated employee. A remake of the 1987 comedy.', '', '2018-05-03', '01:52:00', 6, 42.744, 0),
(454983, 'The Kissing Booth', 'https://image.tmdb.org/t/p/original//xEKx7zPEjN6meomZ7OhV82Mm2jm.jpg', 'https://image.tmdb.org/t/p/original//7Dktk2ST6aL8h9Oe5rpk903VLhx.jpg', 'When teenager Elle\'s first kiss leads to a forbidden romance with the hottest boy in high school, she risks her relationship with her best friend.', '', '2018-05-11', '01:45:00', 8, 43.463, 0),
(458423, 'Mamma Mia! Here We Go Again', 'https://image.tmdb.org/t/p/original//8HKwxHZ23sW8wz4yb28IWnAM1M6.jpg', 'https://image.tmdb.org/t/p/original//aWicerX4Y7n7tUwRAVHsVcBBpj2.jpg', 'On the Greek island of Kalokairi, the daughter of Donna Sheridan, Sophie, finds out more about her mother\'s past while seeking guidance on how to handle her pregnancy.', '', '2018-07-18', '02:00:00', 8, 41.634, 0),
(470878, 'I Can Only Imagine', 'https://image.tmdb.org/t/p/original//9XjNaS2S0RJfjbUPDAzILPprU3r.jpg', 'https://image.tmdb.org/t/p/original//veZszwMZu8d3WMU6TJX9sV5w1Y4.jpg', 'Growing up in Texas, Bart Millard suffers physical and emotional abuse at the hands of his father. His childhood and relationship with his dad inspires him to write the hit song \"I Can Only Imagine\" as singer of the Christian band MercyMe.', '', '2018-03-08', '01:49:00', 7, 52.273, 0),
(476292, 'Maquia: When the Promised Flower Blooms', 'https://image.tmdb.org/t/p/original//cfbjFQ14hSTgXChBEvaEjFiUaKb.jpg', 'https://image.tmdb.org/t/p/original//vOrK1n6VgVCFBwgcq5tMoPCqa47.jpg', 'A story of encounters and partings interwoven between people; this is a human drama with feelings that touch one\'s heart gradually, which everyone has experienced at least once.', '', '2018-02-24', '01:55:00', 6, 72.398, 0),
(492719, 'Godzilla: City on the Edge of Battle', 'https://image.tmdb.org/t/p/original//mu4q1jPLdW5hE7BWZEWRvuAh3ZN.jpg', 'https://image.tmdb.org/t/p/original//hF85hujJ4jelKtlSZ8YdthvjdZt.jpg', 'Humanity\'s desperate battle to reclaim the Earth from Godzilla continues. The key to defeating the King of the Monsters may be Mechagodzilla, a robotic weapon thought to have been lost nearly 20,000 years ago.', '', '2018-05-18', '01:45:00', 6, 70.399, 0),
(493006, 'Detective Conan: Zero the Enforcer', 'https://image.tmdb.org/t/p/original//kEqeponciiz6TyuKWtnKSzXzbGa.jpg', 'https://image.tmdb.org/t/p/original//mMWV5MXn2pkDnnI4vWpy3dRWdNC.jpg', 'There is a sudden explosion at Tokyo Summit\'s giant Edge of Ocean facility. The shadow of TÅru Amuro, who works for the National Police Agency Security Bureau as Zero, appears at the site. In addition, the \"triple-face\" character is known as Rei Furuya as a detective and KogorÅ MÅri\'s apprentice, and he is also known as Bourbon as a Black Organization member. KogorÅ is arrested as a suspect in the case of the explosion. Conan conducts an investigation to prove KogorÅ\'s innocence, but Amuro gets in his way.', '', '2018-04-13', '01:55:00', 5, 68.783, 0);
